import './App.css';
import Pdfs from "./components/Pdfs";
import Axios from 'axios'
import Header from './components/Header';
import React,{useState,useEffect} from 'react';
import CompanyHeader from './components/CompanyHeader';
import ExpandableList from './components/ExpandableList';

function App() {
  const val=4
  const project_list=[
    "http://investor.weyerhaeuser.com/events-and-presentations",
    "https://investor.fb.com/investor-events/",
    "https://informacioncorporativa.entel.cl/investors/presentations",
    "http://ir.homedepot.com/events-and-presentations"
  ]
  const [scraps,setScraps]=useState([])

  useEffect(() => {

    fetchScraps();

  }, [])

  useEffect(() => {

    console.log(scraps)

  }, [scraps])

  const fetchScraps=async()=>{

    const response=await Axios('http://localhost:8000/');

    setScraps(response.data)    

  }
  return (

    <div className="App">
      <Header title="Standalone Project"/>
      <ExpandableList/>
      <CompanyHeader title={project_list[0]}/>
      <CompanyHeader title={project_list[1]}/>
      <CompanyHeader title={project_list[2]}/>
      <CompanyHeader title={project_list[3]}/>
      <Pdfs list_pdfs={scraps.filter(x=>x.company_code===0)}/>
    </div>

  );

}


export default App;
